import CustomImageAvatar from '../components/imageAvatar/imageAvatar';
import '../style/App.css';
import avatar from '../images/avatar.jpg'


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <CustomImageAvatar size="56" imgPath={avatar}></CustomImageAvatar>
      </header>
    </div>
  );
}

export default App;
